import React, { useState } from 'react';
import { FaGoogle, FaFacebook } from 'react-icons/fa';

const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = () => {
    console.log(`Usuário: ${username}, Senha: ${password}`);
  };

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100 dark:bg-gray-800">
      <div className="bg-white dark:bg-gray-700 p-6 rounded-lg shadow-lg w-full max-w-md">
        <h1 className="text-2xl font-bold text-center text-nba-blue dark:text-phoenixsuns-yellow mb-6">
          Login
        </h1>

        {/* Campo de Usuário */}
        <div className="mb-4">
          <label htmlFor="username" className="block text-sm font-medium text-gray-600 dark:text-gray-200">
            Usuário
          </label>
          <input
            type="text"
            id="username"
            placeholder="Digite seu usuário"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-md dark:bg-gray-800 dark:text-white dark:border-gray-600 focus:outline-none focus:ring-2 focus:ring-nba-blue dark:focus:ring-phoenixsuns-yellow"
          />
        </div>

        {/* Campo de Senha */}
        <div className="mb-2">
          <label htmlFor="password" className="block text-sm font-medium text-gray-600 dark:text-gray-200">
            Senha
          </label>
          <input
            type="password"
            id="password"
            placeholder="Digite sua senha"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-md dark:bg-gray-800 dark:text-white dark:border-gray-600 focus:outline-none focus:ring-2 focus:ring-nba-blue dark:focus:ring-phoenixsuns-yellow"
          />
        </div>

        {/* Esqueceu sua senha */}
        <div className="mb-6 text-right">
          <a href="#" className="text-sm text-nba-blue dark:text-phoenixsuns-yellow hover:underline">
            Esqueceu sua senha?
          </a>
        </div>

        {/* Botões de Rede Social */}
        <div className="flex justify-between gap-4 mb-6">
          <button className="flex items-center justify-center w-1/2 p-4 bg-red-600 text-white rounded-md hover:bg-red-700 transition-all duration-300">
            <FaGoogle className="text-2xl mr-2" />
            Entrar com o Google
          </button>
          <button className="flex items-center justify-center w-1/2 p-4 bg-blue-600 text-white rounded-md hover:bg-blue-700 transition-all duration-300">
            <FaFacebook className="text-2xl mr-2" />
            Entrar com o Facebook
          </button>
        </div>

        {/* Botão Entrar */}
        <button
          //onClick={}
          className="w-full p-4 bg-nba-blue text-white rounded-md shadow-md hover:bg-nba-red dark:hover:bg-orange-500 transition-all duration-300"
        >
          Entrar
        </button>
      </div>
    </div>
  );
};

export default Login;
